import React from "react";
import "./screens.css";
import { useDarkMode } from "../context/DarkModeContext";

export const Home = () => {
    const { isDarkMode } = useDarkMode();

    return (
      <div className={isDarkMode ? 'dark-background' : 'background'}>
        <h1 className={isDarkMode ? 'dark-background' : 'background'}>
          Home</h1>
      </div>
    );
};
